#
# Definition for the `vw_anio` view : 
#

CREATE ALGORITHM=UNDEFINED DEFINER='root'@'localhost' SQL SECURITY DEFINER VIEW `vw_anio`
AS
select 
    year(`mytable`.`fecha`) AS `anio`,
    `mytable`.`numero` AS `numero`,
    `mytable`.`fecha` AS `fecha`,
    `mytable`.`arena` AS `arena`,
    `mytable`.`cemento` AS `cemento`,
    `mytable`.`piedra` AS `piedra`,
    `mytable`.`agua` AS `agua` 
  from 
    `mytable` 
  order by 
    `mytable`.`fecha`;

#
# Definition for the `vw_anio_mes` view : 
