#
# Definition for the `vw_anio_semestre` view : 
#

CREATE ALGORITHM=UNDEFINED DEFINER='root'@'localhost' SQL SECURITY DEFINER VIEW `vw_anio_semestre`
AS
select 
    year(`mytable`.`fecha`) AS `anio`,
    if((month(`mytable`.`fecha`) < 7),1,2) AS `semestre`,
    `mytable`.`numero` AS `numero`,
    `mytable`.`fecha` AS `fecha`,
    `mytable`.`arena` AS `arena`,
    `mytable`.`cemento` AS `cemento`,
    `mytable`.`piedra` AS `piedra`,
    `mytable`.`agua` AS `agua` 
  from 
    `mytable` 
  order by 
    `mytable`.`fecha`;

#
# Definition for the `vw_anio_trimestre` view : 
#

CREATE ALGORITHM=UNDEFINED DEFINER='root'@'localhost' SQL SECURITY DEFINER VIEW `vw_anio_trimestre`
AS
select 
    year(`mytable`.`fecha`) AS `anio`,
    quarter(`mytable`.`fecha`) AS `trimestre`,
    `mytable`.`numero` AS `numero`,
    `mytable`.`fecha` AS `fecha`,
    `mytable`.`arena` AS `arena`,
    `mytable`.`cemento` AS `cemento`,
    `mytable`.`piedra` AS `piedra`,
    `mytable`.`agua` AS `agua` 
  from 
    `mytable` 
  order by 
    `mytable`.`fecha`;

